#2bc253\";}s:35:\"_give_close_form_when_goal_achieved\";a:1:{i:0;s:8:\"disabled\";}s:32:\"_give_form_goal_achieved_message\";a:1:{i:0;s:62:\"Thank you to all our donors, we have met our fundraising goal.\";}s:21:\"_give_display_content\";a:1:{i:0;s:7:\"enabled\";}s:23:\"_give_content_placement\";a:1:{i:0;s:13:\"give_pre_form\";}s:18:\"_give_form_content\";a:1:{i:0;s:159:\"Your gift is needed more than ever and will go to work in the heart of communities where children are most in need. Thank you for standing with children today!\";}s:18:\"_give_terms_option\";a:1:{i:0;s:8:\"disabled\";}s:17:\"_give_agree_label\";a:1:{i:0;s:0:\"\";}s:16:\"_give_agree_text\";a:1:{i:0;s:1873:\"Acceptance of any contribution, gift or grant is at the discretion of the Charity 01. The Charity 01 will not accept any gift unless it can be used or expended consistently with the purpose and mission of the Charity 01.\r\n\r\nNo irrevocable gift, whether outright or life-income in character, will be accepted if under any reasonable set of circumstances the gift would jeopardize the donors financial security.\r\n\r\nThe Charity 01 will refrain from providing advice about the tax or other treatment of gifts and will encourage donors to seek guidance from their own professional advisers to assist them in the process of making their donation.\r\n\r\nThe Charity 01 will accept donations of cash or publicly traded securities. Gifts of in-kind services will be accepted at the discretion of the Charity 01.\r\n\r\nCertain other gifts, real property, personal property, in-kind gifts, non-liquid securities, and contributions whose sources are not transparent or whose use is restricted in some manner, must be reviewed prior to acceptance due to the special obligations raised or liabilities they may pose for Charity 01.\r\n\r\nThe Charity 01 will provide acknowledgments to donors meeting tax requirements for property received by the charity as a gift. However, except for gifts of cash and publicly traded securities, no value shall be ascribed to any receipt or other form of substantiation of a gift received by Charity 01.\r\n\r\nThe Charity 01 will respect the intent of the donor relating to gifts for restricted purposes and those relating to the desire to remain anonymous. With respect to anonymous gifts, the Charity 01 will restrict information about the donor to only those staff members with a need to know.\r\n\r\nThe Charity 01 will not compensate, whether through commissions, finders\' fees, or other means, any third party for directing a gift or a donor to the Charity 01.\";}s:33:\"_give_customize_offline_donations\";a:1:{i:0;s:6:\"global\";}s:51:\"_give_offline_donation_enable_billing_fields_single\";a:1:{i:0;s:7:\"enabled\";}s:28:\"_give_offline_checkout_notes\";a:1:{i:0;s:449:\"&nbsp;\r\n\r\nIn order to make an offline donation we ask that you please follow these instructions:\r\n<ol>\r\n 	<li>Make a check payable to \"Charity 01\"</li>\r\n 	<li>On the memo line of the check, please indicate that the donation is for \"Charity 01\"</li>\r\n 	<li>Please mail your check to:</li>\r\n</ol>\r\n<em>Charity 01</em>\r\n<em>111 Not A Real St.</em>\r\n<em>Anytown, CA 12345</em>\r\n\r\nAll contributions will be gratefully acknowledged and are tax deductible.\";}s:19:\"_give_email_options\";a:1:{i:0;s:6:\"global\";}s:20:\"_give_email_template\";a:1:{i:0;s:7:\"default\";}s:16:\"_give_email_logo\";a:1:{i:0;s:0:\"\";}s:15:\"_give_from_name\";a:1:{i:0;s:10:\"Charity 01\";}s:16:\"_give_from_email\";a:1:{i:0;s:20:\"costi.drob@gmail.com\";}s:31:\"_give_new-donation_notification\";a:1:{i:0;s:6:\"global\";}s:32:\"_give_new-donation_email_subject\";a:1:{i:0;s:28:\"New Donation - #{payment_id}\";}s:32:\"_give_new-donation_email_message\";a:1:{i:0;s:400:\"Hi there,\r\n\r\nThis email is to inform you that a new donation has been made on your website: <a href=\"http://sites-wpastra.sharkz.in/alex01\" target=\"_blank\" rel=\"noopener\">http://sites-wpastra.sharkz.in/alex01</a>.\r\n\r\n<strong>Donor:</strong> {name}\r\n<strong>Donation:</strong> {donation}\r\n<strong>Amount:</strong> {amount}\r\n<strong>Payment Method:</strong> {payment_method}\r\n\r\nThank you,\r\n\r\n{sitename}\";}s:37:\"_give_new-donation_email_content_type\";a:1:{i:0;s:9:\"text/html\";}s:28:\"_give_new-donation_recipient\";a:1:{i:0;s:56:\"a:1:{i:0;a:1:{s:5:\"email\";s:20:\"costi.drob@gmail.com\";}}\";}s:35:\"_give_donation-receipt_notification\";a:1:{i:0;s:6:\"global\";}s:36:\"_give_donation-receipt_email_subject\";a:1:{i:0;s:16:\"Donation Receipt\";}s:36:\"_give_donation-receipt_email_message\";a:1:{i:0;s:448:\"Dear {name},\r\n\r\nThank you for your donation. Your generosity is appreciated! Here are the details of your donation:\r\n\r\n<strong>Donor:</strong> {fullname}\r\n<strong>Donation:</strong> {donation}\r\n<strong>Donation Date:</strong> {date}\r\n<strong>Amount:</strong> {amount}\r\n<strong>Payment Method:</strong> {payment_method}\r\n<strong>Payment ID:</strong> {payment_id}\r\n<strong>Receipt ID:</strong> {receipt_id}\r\n\r\n{receipt_link}\r\n\r\nSincerely,\r\n{sitename}\";}s:41:\"_give_donation-receipt_email_content_type\";a:1:{i:0;s:9:\"text/html\";}s:16:\"_give_form_sales\";a:1:{i:0;s:2:\"29\";}s:19:\"_give_form_earnings\";a:1:{i:0;s:5:\"14625\";}s:39:\"_give_new-offline-donation_notification\";a:1:{i:0;s:6:\"global\";}s:40:\"_give_new-offline-donation_email_subject\";a:1:{i:0;s:20:\"New Pending Donation\";}s:40:\"_give_new-offline-donation_email_message\";a:1:{i:0;s:572:\"Dear Admin,\r\n\r\nAn offline donation has been made on your website: Charity 01 Hooray! The donation is in a pending status and is awaiting payment. Donation instructions have been emailed to the donor. Once you receive payment, be sure to mark the donation as complete using the link below.\r\n\r\n<strong>Donor:</strong> {fullname}\r\n<strong>Amount:</strong> {amount}\r\n\r\n<a href=\"http://sites-wpastra.sharkz.in/alex01/wp-admin/edit.php?post_type=give_forms&amp;page=give-payment-history&amp;view=view-order-details&amp;id=0\">Click Here to View and/or Update Donation Details</a>\";}s:45:\"_give_new-offline-donation_email_content_type\";a:1:{i:0;s:9:\"text/html\";}s:36:\"_give_new-offline-donation_recipient\";a:1:{i:0;s:56:\"a:1:{i:0;a:1:{s:5:\"email\";s:20:\"costi.drob@gmail.com\";}}\";}s:47:\"_give_offline-donation-instruction_notification\";a:1:{i:0;s:6:\"global\";}s:48:\"_give_offline-donation-instruction_email_subject\";a:1:{i:0;s:42:\"{donation} - Offline Donation Instructions\";}s:48:\"_give_offline-donation-instruction_email_message\";a:1:{i:0;s:667:\"Dear {name},\r\n\r\nThank you for your offline donation request! Your generosity is greatly appreciated. In order to make an offline donation we ask that you please follow these instructions:\r\n<ol>\r\n 	<li>Make a check payable to \"Charity 01\"</li>\r\n 	<li>On the memo line of the check, please indicate that the donation is for \"Charity 01\"</li>\r\n 	<li>Please mail your check to:</li>\r\n</ol>\r\n<em>Charity 01</em>\r\n<em>111 Not A Real St.</em>\r\n<em>Anytown, CA 12345 </em>\r\n\r\nOnce your donation has been received we will mark it as complete and you will receive an email receipt for your records. Please contact us with any questions you may have!\r\n\r\nSincerely,\r\n\r\nCharity 01\";}s:53:\"_give_offline-donation-instruction_email_content_type\";a:1:{i:0;s:9:\"text/html\";}s:17:\"_give_form_status\";a:1:{i:0;s:4:\"open\";}s:24:\"_give_form_goal_progress\";a:1:{i:0;s:2:\"-1\";}}}}}s:23:\"astra-site-wpforms-path\";s:72:\"https://websitedemos.net/wp-content/uploads/astra-sites/173/wpforms.json\";s:25:\"astra-site-cartflows-path\";s:0:\"\";s:27:\"astra-site-taxonomy-mapping\";a:1:{s:4:\"post\";a:1:{s:8:\"category\";a:1:{i:0;a:2:{s:2:\"id\";i:1;s:4:\"slug\";s:13:\"uncategorized\";}}}}s:20:\"astra-site-parent-id\";i:166;s:14:\"license-status\";s:7:\"upgrade\";s:12:\"request_time\";d:0.05362701416015625;s:6:\"_links\";a:9:{s:4:\"self\";a:1:{i:0;a:1:{s:4:\"href\";s:56:\"https://websitedemos.ne