(309, 'wpforms_notifications', 'a:4:{s:6:\"update\";i:1606839480;s:4:\"feed\";a:4:{i:0;a:6:{s:5:\"title\";s:70:\"Cyber Monday: Dont Miss This HUGE Sale! Claim Up to 70% Off WPForms\";s:7:\"content\";s:295:\"Its the best time of the year to buy WPForms. Save up to 70% off the worlds easiest to use form builder plugin, and unlock groundbreaking premium features like our advanced form fields, smart conditional logic, entry management, surveys & polls, form pages, conversational forms, and more!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:51;s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:152:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=BF2020 Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}}s:5:\"start\";s:19:\"2020-11-23 16:42:21\";}i:1;a:6:{s:5:\"title\";s:47:\"Get Deeper Insights with the User Journey Addon\";s:7:\"content\";s:258:\"Discover the steps your visitors take before they submit your forms, without all the complicated analytics. With our new User Journey addon you can easily see the content thats driving the most valuable form conversions, right in your WordPress dashboard.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:41;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/introducing-user-journey-addon-wpforms/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=UJ Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:153:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=UJ Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2020-11-23 16:42:21\";}i:2;a:6:{s:5:\"title\";s:77:\"New in WPForms! A Divi Module, Email Address Restrictions + Date/Time Limits.\";s:7:\"content\";s:339:\"Controlling forms has never been easier. WPForms now lets you easily add forms right inside the Divi page builder, so you can ditch the shortcodes. Not only that, but you can now block or allow specific email addresses, and theres a new datepicker field in town that lets you set date and time limits. Plus, an easy-to-find Help Menu.\r\n\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:37;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:225:\"https://wpforms.com/introducing-wpforms-1-6-3-divi-module-email-address-restrictions-date-time-limits-more/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 1.6.3 Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:164:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 1.6.3 Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2020-11-23 16:42:21\";}i:3;a:6:{s:5:\"title\";s:69:\"Introducing WPForms Webhooks - Powerful Flexibility With Integrations\";s:7:\"content\";s:286:\"With the new WPForms Webhooks addon, you can automatically send data from forms to other tools and apps, without a 3rd-party connector. This power-user feature will help save time and money as you automate your forms. Upgrade to an Elite license now to start using this awesome feature.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:30;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:161:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Webhooks Lite Get WPForms Elite\";s:4:\"text\";s:17:\"Get WPForms Elite\";}s:3:\"alt\";a:2:{s:3:\"url\";s:176:\"https://wpforms.com/introducing-the-webhooks-addon-for-wpforms/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Webhooks Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}}s:5:\"start\";s:19:\"2020-11-23 16:42:21\";}}s:6:\"events\";a:0:{}s:9:\"dismissed\";a:0:{}}', 'ye